import React from "react";
import PortionTop from "../Assets/PortionTop";
import CategoryCard from "./CategoryCard";
import FilterDropdown from "../Assets/FilterDropdown";

export default function Category() {
  const planSort = [
    { id: 'plan-0', value: 'Both' },
    { id: 'plan-1', value: 'Free' },
    { id: 'plan-2', value: 'Pro Essential' }
]
const assetsSort = [
    { id: 'asset-0', value: 'HTML 5' },
    { id: 'asset-1', value: 'CSS 3' },
    { id: 'asset-2', value: 'Javascript' },
    { id: 'asset-3', value: 'Jquery' },
    { id: 'asset-4', value: 'React Js' }
]
const ItemsSort = [
    { id: 'item-0', value: 'Most Popular' },
    { id: 'item-1', value: 'Likes High to Low' },
    { id: 'item-2', value: 'Likes Low to High' }
]
  return (
    <>
      <div className="carousel-wrapper">
      <div class="review-contact-head"><h1>All Categories</h1><p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Maiores, iusto?</p></div>
      <div className='filter-topbar'>
                    <div className='filter-topbar-head'>
                         Filters
                    </div>
                    <div className='filter-dropdowns'>
                        <FilterDropdown List={assetsSort} btnIcon="fa-regular fa-tag" Unique="one" btnTitle="Select Assets" IsCheck={true} Search={true} />
                        <FilterDropdown List={planSort} btnIcon="fa-regular fa-crown" Unique="two" btnTitle="Free/Pro" IsCheck={true} />

                        <FilterDropdown List={planSort} btnIcon="fa-regular fa-list" Unique="four" btnTitle="Select Category" />
                        <FilterDropdown List={ItemsSort} btnIcon="fa-regular fa-sort" Unique="three" btnTitle="Sorting Items" />
                    </div>

                </div>
        <div className="card-carousel col-4">
          <CategoryCard
            cat={"html"}
            icon={"fa-light fa-chart-tree-map"}
            title={"Semantic HTML 5"}
            desc={"Simple And Easy Server Side Language Card 1 Description"}
          />

          <CategoryCard
            cat={"css"}
            icon={"fa-light fa-bezier-curve"}
            title={"Styled With CSS 3"}
            desc={"Card 2 Description Simple And Easy Server Side Language"}
          />

          <CategoryCard
            cat={"js"}
            icon={"fa-light fa-chart-network"}
            title={"Logical Javascript"}
            desc={
              "Pixels, code, and everything nice, that's what JavaScript is made of."
            }
          />

          <CategoryCard
            cat={"php"}
            icon={"fa-light fa-aperture"}
            title={"HyperText Preprocessor"}
            desc={
              "Simple And Easy Server Side Language Simple And Easy Server Side Language"
            }
          />

          <CategoryCard
            cat={"mysql"}
            icon={"fa-brands fa-cloudversify"}
            title={"MySql Database"}
            desc={
              "Simple And Easy Server Side Language Simple And Easy Server Side Language"
            }
          />

          <CategoryCard
            cat={"react"}
            icon={"fa-brands fa-react"}
            title={"React Js"}
            desc={
              " Simple And Easy Server Side Language vSimple And Easy Server Side Language"
            }
          />
        </div>
      </div>
    </>
  );
}
